import React from "react";

class Image extends React.Component {
    render() {
        const{src, alt, className} = this.props

        return (
                <img
                    src={src}
                    alt={alt}
                    className={className}
                />
        )
    }
};

Image.defaulProps = {
    src:"https://via.placeholder.com/100*100",
    alt:"image name",
    className: ''
}

export default Image;
